import s from './atFriends.module.css'

const AtFriends = (props)=>{
  return(
    <div className={s.at_friends}>
      <div>{props.type} at friends</div>
      <div className={s.list_of_friends}>
        <div className={s.friendElem}><div>Friend 1</div> <div>Watched</div></div>
        <div className={s.friendElem}><div>Friend 2</div> <div>Watched</div></div>
        <div className={s.friendElem}><div>Friend 3</div> <div>Watched</div></div>
        <div className={s.friendElem}><div>Friend 4</div> <div>Watched</div></div>
        </div>
      <div className={s.pagesNButtons}>
        <button>Back</button>
        <div>1/1</div>
        <button>Forward</button>
      </div>
    </div>
  )
};

export default AtFriends;
